import React from "react";
import styles from "./filterByType.module.css";

function FilterbyTypes() {
  return (
    <div className={styles.filterByType}>
      {" "}
      <input type="text" list="cars" />
      <datalist id="cars">
        <option>Volvo</option>
        <option>Saab</option>
        <option>Mercedes</option>
        <option>Audi</option>
      </datalist>{" "}
    </div>
  );
}

export default FilterbyTypes;
